import './Navigation.scss';

//Components
import PageLinks from './PageLinks';
import Contacts from './Contacts';

export default function Navigation(props){

    return (
        <nav className={props.navOpenState ? "Navigation open" : "Navigation closed"}>
            <PageLinks toggleMenu={props.toggleMenu} navOpenState={props.navOpenState} pages={props.pages}/>
            <div className="curved">
                <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320"><path fill="#000 " fill-opacity="1" d="M0,160L48,144C96,128,192,96,288,80C384,64,480,64,576,74.7C672,85,768,107,864,133.3C960,160,1056,192,1152,202.7C1248,213,1344,203,1392,197.3L1440,192L1440,320L1392,320C1344,320,1248,320,1152,320C1056,320,960,320,864,320C768,320,672,320,576,320C480,320,384,320,288,320C192,320,96,320,48,320L0,320Z"></path></svg>
            </div>
            <Contacts/>
        </nav>
    );
}
